#include <iostream>#include <vector>#include <cmath>#include <iomanip>#include <algorithm>using namespace std;typedef long long ll;int main() {int n;cin >> n;vector<int> v(n);for (int &i : v) {cin >> i;}sort(v.begin(), v.end());for (int i = n - 1; i >= 0; --i) {if (i >= 1) {int j = sqrt(v[i]);if (j * j != v[i]) {cout << v[i] << endl;return 0;}} else {cout << v[i] << endl;return 0;}}}